import '../../Css/GroupItem.css';
import groupItem_image from '../../img/groupItem_image.jpg';
import groupItem_image1 from '../../img/groupitem_image1.PNG';
import groupItem_image2 from '../../img/groupitem_image2.jpg';
import groupItem_image3 from '../../img/groupitem_image3.jpg';
import groupItem_image4 from '../../img/groupitem_image4.png';
import React, { useState, useEffect } from "react";
import axios from 'axios';
import { Link } from 'react-router-dom';

function GroupItemView(){

    const [list , SetList] = useState([]);

    const photos = [groupItem_image, groupItem_image1, groupItem_image2,groupItem_image3, groupItem_image4]

    useEffect(()=> {
      axios.get('/groupItem').then((res)=>{
        SetList(res.data)
        console.log(res)
      })
    },[])


      return (
        <div id="groupItem_view_main">
        {
        list.map(function(a,i){
          return(
            <Link to={'/groupItem/detail/'+list[i].groupItem_id} className="/groupItem">                    
            <img className="groupItem_image1" src={photos[i]}></img>
            <div class="groupItem_info">
            <div className="groupItem_name">{list[i].groupItem_name}</div>
            <div className="groupItem_price">{list[i].groupItem_price}</div>
            <div className="groupItem_num">{list[i].groupItem_num}</div>
            </div>
          </Link>
          )

        })
    }

      </div>   



      );
}


export default GroupItemView;
